  false,\n\t\"url\": null,\n\t\"notes\": \"An oyster survey was conducted at St. Vincent
  Sound and St. George Sound in1896, and the results of the survey are presented in
  this report.  The object of the survey was to determine: (1) the positions, outlines,
  characteristics, and richness or productiveness of all oyster beds located in the
  waters and (2) the positions, outlines, and characteristics of all areas of the
  bottom in the same waters, suitable for the planting of oysters, either in their
  natural conditions or after preparation.  It was found that the whole eastern portion
  of the St. Vincent Sound was well fitted by nature for the cultivation of oysters.\",\n\t\"license_title\":
